import React from 'react';
import { Link, Router } from "react-router-dom";

const Footer = () => {
	return (
		<div className='Footer'>
			<Router>
				<ul>
					<li>
		              <Link to="https://facebook.com/">facebook</Link>
		            </li>
		        </ul>
		    </Router>

  		</div>
	);
}

export default Footer;
